import React from 'react';
import './App.css';
import Home from './components/home.js';

const App = () => {
  return(
    <BrowserRouter>
      <Navbar />
      <div className="container mt-2" style={{ marginTop: 40 }}>
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/about">
            <About />
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
    // <div>
    //  <Home/>
    // </div>
  );
}

export default App;
